Divertimento pessoal: 10/10

Rodeo com certeza é o meu álbum favorito de todos os tempos, e Travis Scott é o meu artista favorito de todos os tempos também, o jeito que ele cria música não é normal, igual ao seu primeiro álbum. Eu quero destacar a consistência, a lírica, os features que são muitos, e não obscurecem o artista principal, e são totalmente diferentes uns dos outros, e, principalmente, a produção, que é simplesmente estupenda, e está entre os Top 50 álbuns mais bem produzidos da história do Hip-Hop, um trabalho feito por eles: Metro Boomin, Allen Ritter, Frank Dukes, WondaGurl, Sonny Digital, Southside, TM88, FKi, DJ Dahi, Eestbound, Illangelo, The Weeknd, Mano, Ben Billions, Maneesh, Pharrel Williams, Charlie Heat, Kanye West, Mike Dean e o nosso astro, Travis Scott, que arquitetou tudo para ter como produto final, o melhor álbum de Trap até hoje. Rodeo é a estética e o álbum é trilha sonora, diferente dos traps genéricos da nova geração, que são repetitivos, ou andam em círculos e não do lugar, Rodeo anda em diferentes pontos, e em cada um deles, vai evoluindo mais e mais, em linha reta. Com certeza Kanye West e T.I. têm orgulho de terem sido mentores desse sulista, que marcou Houston no mapa, que trouxe uma nova cara para o Hip-Hop Sulista e para o Trap. Hoje faz 5 anos desse projeto incrível, que tive o prazer de escutar, e aqui está uma forma diferente de prestar uma homanagem à obra prima de Travis Scott.
